// src/pages/RepositoriesPage.js
import React, { useState } from 'react';
import CreateRepository from './CreateRepository';

const RepositoriesPage = () => {
  const [repositories, setRepositories] = useState([
    // Placeholder repositories, replace with backend data later
    { id: '1', name: 'repo1', description: 'Description of repo1' },
    { id: '2', name: 'repo2', description: 'Description of repo2' },
  ]);

   const handleCreateRepo = (newRepo) => {
    setRepositories((prevRepos) => [...prevRepos, newRepo]);
  };

  return (
    <div>
      <CreateRepository onCreate={handleCreateRepo} />
      <div className="repository-list">
        {repositories.map((repo) => (
          <div key={repo.id} className="repo-card">
            <h3>{repo.name}</h3>
            <p>{repo.description}</p>
            <button>View Files</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default RepoDetailsPage;
